  //   onChange(validNum)
  // }

  function loginCurrentStr(e) {
    console.log(password)
    console.log(login)

    const login = e.target.value
    console.log(login)
  }

  function valueCurrentStr(e) {
    console.log(password)
    console.log(login)

    const password = e.target.value
    console.log(password)
    onChange(login, password)
    // onChange(password)
    //   applyCurrent(Number.isNaN(num) ? min : num)
  }

  const inc = () => console.log('вход')

