    <div>
      <table>
        <tbody>
          <tr>
            <td width="10"></td>
            <td>
              <input
                type="text"
                placeholder="Логин"
                // value={login}
                onChange={loginCurrentStr}
              />
              <input
                type="text"
                placeholder="Пароль"
                // value={password}
                onChange={passwordCurrentStr}
              />
              <button type="button" onClick={inc}>
                Войти
              </button>
            </td>
          </tr>
        </tbody>
      </table>
    </div>
  )
}

export default Login
